import { FETCH_FOODS } from "../constants/actionTypes"

const initialState = {
  products: []
}

export const foodsReducer = (state = initialState, action) => {
  switch (action.type) {
    case FETCH_FOODS:        
      return { ...state,products: action.payload.data } 
      
    default:
      return state
  }
};
